import React from 'react'

function GlobalFilter({filter,setFilter}) {
  return (
    <span>
        <input value={filter || ''} onChange={(e)=> setFilter(e.target.value)} placeholder='Search...'/>
    </span>
  )
}

export default GlobalFilter
